import React from 'react';
import ProjectList from './projectList';

//6 applications with github link and working page link

let projects = [
  {name: "Run Buddy", description: "HTML & CSS", image: "link", github: "", workingPage: ""},
  {name: "Weather Dashboard", description: "APIs", image: "link", github: "", workingPage: ""},
  {name: "Event Finder", description: "APIs", image: "link", github: "https://github.com/ivydo/Event-Finder", workingPage: "https://ivydo.github.io/Event-Finder/"},
  {name: "Pizza Hunt", description: "NoSQL", image: "link", github: "", workingPage: ""},
  {name: "Budget Tracker", description: "Offline & PWA", image: "link", github: "", workingPage: ""},
  {name: "Retro Rewind", description: "Sequalize & Express", image: "link", github: "https://github.com/kelsey-schenk/retro-rewind", workingPage: ""}
];

function Portfolio() {

  return (
    <div>
      <h1>Portfolio</h1>

      <section>
        {projects.map( (item, index) => (
          <p> {item.name} </p>
        ))}
      </section>

    </div>
  );
}

export default Portfolio;
